SELECT JSONExtractString(toString(data.JSON), 'kind') as kind, count() FROM bluesky_minimal_1m.bluesky_data GROUP BY kind ORDER BY count() DESC SETTINGS max_threads = 1, max_memory_usage = 4000000000;
SELECT JSONExtractString(toString(data.JSON), 'commit', 'collection') as collection, count() FROM bluesky_minimal_1m.bluesky_data WHERE collection != '' GROUP BY collection ORDER BY count() DESC LIMIT 10 SETTINGS max_threads = 1, max_memory_usage = 4000000000;
SELECT count() FROM bluesky_minimal_1m.bluesky_data WHERE JSONExtractString(toString(data.JSON), 'kind') = 'commit' SETTINGS max_threads = 1, max_memory_usage = 4000000000;
SELECT count() FROM bluesky_minimal_1m.bluesky_data WHERE JSONExtractUInt(toString(data.JSON), 'time_us') > 1700000000000000 SETTINGS max_threads = 1, max_memory_usage = 4000000000;
SELECT JSONExtractString(toString(data.JSON), 'commit', 'operation') as op, JSONExtractString(toString(data.JSON), 'commit', 'collection') as coll, count() FROM bluesky_minimal_1m.bluesky_data WHERE op != '' AND coll != '' GROUP BY op, coll ORDER BY count() DESC LIMIT 5 SETTINGS max_threads = 1, max_memory_usage = 4000000000;
